import React, { Component } from 'react'
import { Header } from 'grommet';

export class Entete extends Component {
    theme = {
        global: {
          font: {
            family: 'Roboto',
            size: '18px',
            height: '20px',
          },
        },
    };
    render() {
        return (
            <Header justify='center' theme={theme}>
                <h1>SALUT LES LOOSERS</h1>
            </Header>
        )
    }
}

export default Entete
